import React from 'react';
import {Route, Switch} from 'react-router-dom';
import About from './About';
import Contanct from './Contact';

const App = () =>{
    return  (
        <>
        <Switch>
            <Route exact path='/' component={About} />
            <Route path='/contact' component={Contanct} />
        </Switch>
        
        </>
    )
}

export default App;
